const dummyReviewsOverTime = [
    {name: "2019-10-02", reviews: 1},
    {name: "2019-5-10", reviews: 2},
    {name: "2019-02-14", reviews: 4},
    {name: "2018-11-03", reviews: 2},
    {name: "2018-6-05", reviews: 6},
];

export default dummyReviewsOverTime.reverse();
